function GetDetails(n,t){var i=GetSearchParam(n,t);HttpPost(`/LegalReport/GetDetails`,"html",i,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(n,t){var i=$("#Id option:selected").val(),r=$("#CaseNO option:selected").val(),u=$("#ContemptOfCourt option:selected").val(),f=$("#CourtTypeId option:selected").val(),e=$("#CaseStatusId option:selected").val(),o=$("#ZoneId option:selected").val(),s=$("#LocalityId option:selected").val(),h=$("#StayInterimGranted option:selected").val(),c=$("#Judgement option:selected").val(),l=$("#txtFromDate").val(),a=$("#txtToDate").val();return{name:"test",pageSize:parseInt(t),pageNumber:parseInt(n),FileNo:parseInt(i),CaseNo:parseInt(r),ContemptOfCourt:parseInt(u),CourtType:parseInt(f),CaseStatus:parseInt(e),Zone:parseInt(o),Locality:parseInt(s),StayInterimGranted:parseInt(h),Judgement:parseInt(c),FromDate:l,ToDate:a}}function onPaging(n){GetDetails(parseInt(n),parseInt(currentPageSize));currentPageNumber=n}function onChangePageSize(n){GetDetails(parseInt(currentPageNumber),parseInt(n));currentPageSize=n}function GetLocalityList(n){HttpGet(`/LegalReport/GetLocalityList/?zoneId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#LocalityId").html(i)})}function GetCourtCaseNoList(n){HttpGet(`/LegalReport/GetCourtCaseNoList/?filenoId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].courtCaseNo+"<\/option>";$("#CaseNO").html("");$("#CaseNO").html(i)})}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){$("#btnGenerate").click(function(){var n=ValidateForm();n&&GetDetails(currentPageNumber,currentPageSize)})});